import {motion} from 'framer-motion';

const Home = ({darkMode}) => {
    const darkClassNames = darkMode ? 'bg-black text-gray-500' : 'bg-yellow-500 text-gray-800'
    return (
        <div className={`${darkClassNames} border-2 h-[100vh] flex flex-col justify-center items-center snap-center `}>
            <div className='border-2 w-[70%] h-[60vh] flex flex-col'>
                <motion.span transition={{delay:0.4, duration:1.2}}>Home</motion.span>
            </div>
        </div>
    )
}

export default Home;
